import React from "react";

const Explore = () => {
  return (
    <div>
      <h1>Explore Airbnb</h1>
      <div>
        <div style={{ width: "389.33px", height: "84px" }}>
          <img src="/images/explore.jpg" width="126px" height="84px" />
          <div style={{ padding: "0px 16px 0px 24px" }}>
            <h2>Stays</h2>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Explore;
